import React from 'react';
import { Helmet } from 'react-helmet';

const MetaTags = () => {
    return (
        <Helmet>
            <title>Local Restaurant Finder</title>
            <meta name="description" content="Discover local restaurants, view their menus, and find the best dining options near you." />
            <meta name="keywords" content="restaurants, local dining, food, cuisine, restaurant finder" />
            <meta name="author" content="Your Name" />
            <meta property="og:title" content="Local Restaurant Finder" />
            <meta property="og:description" content="Find the best local restaurants and explore their offerings." />
            <meta property="og:image" content="URL_to_your_image" />
            <meta property="og:url" content="https://yourwebsite.com" />
            <meta name="twitter:card" content="summary_large_image" />
            <meta name="twitter:title" content="Local Restaurant Finder" />
            <meta name="twitter:description" content="Explore local dining options and find your next meal." />
            <meta name="twitter:image" content="URL_to_your_image" />
        </Helmet>
    );
};

export default MetaTags;
